        return gameOverMessage = "GAME IS OVER!!!"
    } else {
        return gameOverMessage = ""
    }
}
    return(
        <div className = "gameOver">
            <h1>Game Over! Score: {props.score}</h1>
            <h2>{gameOverMessage}</h2>
        </div> 

    )
}

